column679:
@muslimhayd65149 @raghad_ghalib لا والله هذا متعمد بتحريف القران
بشرفك انت مقتنع يريد يضوجنا؟
غير يبني منظومة كهرباء يبني مجمعات للفقراء يؤوي الايتام يسير على نهج الامام علي مو يحرف القران لان هذا يضوج ويغيض المسلمين جميعاً ومن لا يغتاض او يفضب على دين الله عندما يحرف او يسب فهو ليس بمسلم. فهمت يا إيراني الهوى.
